import React, { Component } from "react";
import "../../index.css";

class Footer1 extends Component {
  render() {
    return (
            <section class="py-5">
              <div class="container">
                <div class="row">
                  <div class="col-md-5">
                    <h1>
                      Menjadi Investor <br/> UMKM itu gampang
                    </h1>
                  </div>
                  <div class="col-md-3">
                    <div class="description">Berinvestasi pada UMKM bisa dilakukan oleh siapa saja dan dimana saja.</div>
                  </div>
                </div>

                <div class="row">
                </div>
              </div>
            </section>
    )
  }
}

export default Footer1;
